import React from "react";
import { NavItem, Navbar } from "react-materialize";

class Nav extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
      return (
<Navbar brand={<a />} centerLogo alignLinks="left">
<NavItem onClick={onClick}>
Getting started
</NavItem>
<NavItem href="components.html">
Components
</NavItem>
</Navbar>
      )
  }
}

export default Nav;
